import React from 'react';

import Typography from '@material-ui/core/Typography';
import {makeStyles} from '@material-ui/core/styles';
import {Card, CardContent, CardActions, Button} from '@material-ui/core';

const useStyless = makeStyles(theme => ({
    root: {
        padding: theme.spacing(3, 2),
        backgroundColor: '#607d8b',
        color: 'white',
        margin: "10 0"
    }
}));

const Cart = props => {
    const classes = useStyless();
    return (
        <Card className={
            classes.root
        }>
           <CardContent>
           <Typography component="h3" variant="h5">
                {
                props.item.title
            } </Typography>
            <Typography component="p">
                {
                props.item.text
            } </Typography>
           </CardContent>
            <CardActions>
                <Button color="inherit" onClick={props.handleDel(props.item.id)}>
                    Remove
                </Button>
                {/* <Button variant="primary" color="inherit" onClick={props.handleEdit(props.item)}>
                    Edit
                </Button> */}
            </CardActions>
        </Card>
    );
}

export default Cart;
